import React from 'react';

function Track({
  track: {
    name,
    artists,
    album: { images },
  },
  addTrack,
}) {
  return (
    <div className="track">
      <img src={images[0].url} alt="Track" />
      <div className="info">
        <h3>{name}</h3>
        <div>
          <ul>
            {artists.map((artist) => (
              <li>{artist.name}</li>
            ))}
          </ul>
        </div>
        <button type="button" onClick={addTrack}>
          Add
        </button>
      </div>
    </div>
  );
}

export default Track;
